function Main() {
  return(
    <main className="content">
      <section className="profile">
        <img src="#" alt="Аватар" className="profile__avatar"/>
        <div className="profile__avatar-overlay"></div>
        <div className="profile__info">
          <h1 className="profile__name"></h1>
          <button className="profile__edit-button button" type="button" aria-label="Редактировать"></button>
          <p className="profile__about"></p>
        </div>
        <button className="profile__add-button button" type="button" aria-label="Добавить картинку"></button>
      </section>
      <section className="gallery">
        <ul className="gallery__list"></ul>
      </section>
    </main>
  );
}

export default Main;
